import{ React,useState, useEffect} from 'react'
import CardList from "../CardList";
import axios from 'axios';
import properties from '../../properties'
// import { Footer } from 'pages/HomePage/components/Footer';
import { DifferentPropertiesHeader } from 'pages/DifferentPropertiesHeader';
import { useLocation } from 'react-router';
// import Header from 'pages/HomePage/components/Header';
import { SubPropertyListHeader } from 'pages/PropertyListHeader';
import { Footer } from 'comman/components/Footer';
import Header from 'comman/components/Header';
// import { CardBox } from 'pages/CardBox';


 const PropertyList = ({city,setCity,setLocation}) => {
      const location=  useLocation();
      console.log("city dikhao"+location);
      setCity(location.state.city);
     const [fetchProperties, setFetchProperties] = useState([]);
     const [cityy,setCityy]=useState()
     useEffect(() => {
        getData();



     }, [location.state]);

    async function getData() {
        const fetchData={city:location.state.city,flat:location.state.flat,reason:location.state.reason, maxbudget:location.state.maxbudget,minbudget:location.state.minbudget,location:location.state.area,onebedroom:location.state.onebedroom,twobedroom:location.state.twobedroom,threebedroom:location.state.threebedroom}
        console.log("dikha do be pagal"+fetchData);
        const propertiesResult = await axios.get(properties.search_url, { params: fetchData });
        console.log(propertiesResult);
        setFetchProperties(propertiesResult.data.data);
        setCityy(fetchData)

    }
    return (
        <div>

             <Header
             city={location.state.city}
             setCity={setCity}   
             />
           <SubPropertyListHeader
           city={city}
           setCity={setCity}
           />
      {  cityy &&
           <DifferentPropertiesHeader
           city = {cityy.city}
           flat = {cityy.flat}
           reason={cityy.reason}
           price={cityy.flat_price}
 fetchPropHeader = {fetchProperties}

           />}


                    {
                        fetchProperties
                        //fetchProperties.sort((a, b) => a.flat_price > b.flat_price ? -1 : 1)
                        .map((property,index)=>{
                            return (
                                <CardList
                                id={property.id}
                                city={property.city}
                                flatprice={property.flat_price}
                                location={property.location}
                                per_square_fit={property.per_square_fit}
                                furnish_status={property.furnished_status}
                                images={property.property_images}
                                reason={property.reason}
                                type={property.type}

                                />

                        )})
                    }
                          <Footer/>

        </div>
    )
}


export default  PropertyList
